import "./Admin.css";

import React from "react";
import Sidebar from "./Sidebar";
import SidebarButton from "./SidebarButton";
import { WrenchIcon, UserIcon } from "../../Global";
import { useHistory } from "react-router-dom";

const Admin = () => {
	const history = useHistory();
	return (
		<div id="admin-page">
			<Sidebar id="side-bar">
				<h2>Hệ thống</h2>
				<SidebarButton icon={UserIcon} onClick={() => history.push("/")}>
					Khách hàng{" "}
				</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Hóa đơn</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Nhân viên</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Quản lý</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Thống kê</SidebarButton>
			</Sidebar>
			<Route path="/" element={"Hello"} />
			<Route path="/admin" element={<Admin />} />
		</div>
	);
};

export default Admin;
